import React, {Component, Fragment} from 'react';
import styled from "styled-components";

class App extends Component{
  render() {
    return (
      <Fragment>
        <button danger/>
        <button/>
      </Fragment>
    );
  }
}

const Button = ({ danger }) => {
  <button className={danger? "button button-danger" : "button button-success" }>Hello</button>
}
export default App;
